import React,{Component} from 'react';
import './Rank.css'
import'tachyons';
class Rank extends React.Component{
	render(){
	const {user} = this.props.user;
	return(
		<div className=''>
		<div className=' f3 primaryfont'>
		{'User your current rank is..'}
		</div>
		<h1>
		{this.props.user}
		</h1>
		</div>
		);  //return ends here
}  //render ends here
}  //class ends here
export default Rank;
